import React, { useState, useEffect } from 'react';

const Header: React.FC = () => {
    const [welcomeText, setWelcomeText] = useState("Supporting Settled Afghan Refugees in Scotland");

    useEffect(() => {
        const interval = setInterval(() => {
            setWelcomeText((prevText) => (prevText === "Supporting Settled Afghan Refugees in Scotland" ? "د په اسکاټلنډ کې سکوني افغان پناڼه ملاتړ کول" : "Supporting Settled Afghan Refugees in Scotland"));
        }, 2000);
        return () => clearInterval(interval);
    }, []);

    const backgroundImage = "data:image/jpeg;base64,";

    return (
        <header className="bg-secondary-500 py-12" style={{ 
            backgroundImage: `url(${backgroundImage})`, 
            backgroundSize: 'cover', 
            backgroundPosition: 'center',
            height: '100vh', 
            display: 'flex', 
            justifyContent: 'center', 
            alignItems: 'center',
        }}>
            <div className="container mx-auto px-4 text-center">
                <h1 className="text-4xl font-bold text-white mb-6 transition-opacity duration-500 ease-in-out">{welcomeText}</h1>
                <p className="text-lg text-white mb-8">Our mission is to provide assistance and support to Afghan refugees who have settled in Scotland, helping them to find sustainable work and rebuild their lives.</p>
            </div>
        </header>
    );
};

export default Header;